import React from 'react'
import Header from '../../components/admin/Header'
import Sidebar from '../../components/admin/Sidebare';
import QuickInfo from '../../components/admin/QuickInfo';

const Deshboard = () => {
  return (
    <div>
        <Header></Header>
        <div className='w-full flex  '>
            <Sidebar></Sidebar>
            <div className='w-full p-1'>
                <QuickInfo></QuickInfo>
            </div>

        </div>

     <div className='h-[2000px] bg-red-400 w-full border border-blue-600'></div>
    </div>
  )
}

export default Deshboard;
